script: |
  super -f text -I q5130.spq | sort > q5130.out

inputs:
  - name: q5130.spq
    data: |
      SELECT DISTINCT col1 * col0 col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE - col1 * + - col1 * col0 < 43 + - CAST ( - - ( - col0 ) AS INTEGER ) / 42;
  - name: tab1

outputs:
  - name: q5130.out
    data: |
